                            <div className="namefilm">{props.name}</div>
                            <div className="rate"> <box-icon type='solid' name='star' color='#FDCC0D'></box-icon>{props.rate}</div>
                            </div>
                        </div>
                    </div>
                    
                </div>
         
        </Container>
    </div>
)
}
export default Newfilms;
